import React, { useState } from 'react';
import { useHistory } from "react-router-dom";
const axios = require('axios');

export const NavbarComponent = () => {
    let history = useHistory();
    return (
        <>
            <nav class="navbar" role="navigation" aria-label="main navigation">
                <div class="navbar-brand">
                    <h3> Welcome to our app, {sessionStorage.getItem('username')}!!</h3>
                </div>

                <div class="navbar-end">
                    <div class="navbar-item">
                        <div class="buttons">
                            <button class="button is-primary" onClick={() =>

                                axios.get(`http://localhost:8011/oauth/revoke-token/${sessionStorage.getItem('username')}`, {
                                    headers: {
                                        'Content-Type': 'application/json',
                                        'Authorization': 'Bearer '+JSON.parse(sessionStorage.getItem('user_token')).data.access_token
                                    }
                                }
                                )
                                    .then(function (response) {
                                        // handle success

                                    })
                                    .catch(function (error) {
                                        // handle error

                                    })
                                    .finally(function () {
                                        // always executed
                                        sessionStorage.removeItem('user_token');
                                        history.push('/')
                                    })

                                }>
                                Logout
                            </button>
                    </div>
                </div>
                </div>
        </nav >
        </>
    );
}

export default NavbarComponent;
